    false,nt"url": null,nt"notes": "Communication scenario between the branch
    of Listing and Recovery, Fish and Wildlife Enhancement, and Fish Springs National
    Wildlife Refuge (NWR), in regards to the Fish Springs pond snail contract and status.
     There has been considerable information passed on to Fish Springs NWR since 1977
    when a cursive survey for the Fish Springs Pond snail was conducted by David Bickel.
    The Fish Springs NWR was kept informed from the time the contract was let on August
    26, 1985, to its completion in December 1986. The NWR knew that the information
    on the snail was negative before either the Field or Regional Office. Supporting
    information is provided in chronological order.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
